import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="bg-blue-500 text-white p-4">
      <h1 className="text-2xl font-bold">Hub Automotivo</h1>
      <p>Bem-vindo ao seu hub de informações automotivas!</p>
    </div>
  );
}

export default App;
